def max_sum_increasing_subsequence(arr):
    n = len(arr)
    dp = arr.copy()
    for i in range(1, n):
        for j in range(i):
            if arr[i] > arr[j]:
                dp[i] = max(dp[i], dp[j] + arr[i])
    return max(dp)

arr = [4, 6, 1, 3, 8, 4, 6]
print(max_sum_increasing_subsequence(arr))
